script: |
  super -f text -I q7520.spq | sort > q7520.out

inputs:
  - name: q7520.spq
    data: |
      SELECT ALL - col1 AS col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE - col1 NOT BETWEEN 49 / - + 39 + - 64 + col1 AND col2 / - col0;
  - name: tab0

outputs:
  - name: q7520.out
    data: |
      -81
